import React, { Component } from 'react';
import styled from 'styled-components';

const Main = styled.div`
    position: absolute;
    top: 50px;
    left: 1000px;
`;

class Symbol extends Component {
    state = { 
        rect: {
            left:   0,
            top:    0,
            right:  0,
            bottom: 0
        }
    }

    render() {
        return ( 
            <Main> 
                <img src={this.props.src} width="50px" />
            </Main>
        );
    }
}

export default Symbol;
